CREATE DEFINER=`root`@`localhost` PROCEDURE `loadModuleAccessPerUserType` (`pUserTypeID` INT)  BEGIN
	SELECT 
		uma.*, 
		m.MODULE_NAME, 
		m.PAGE_URI,
		ut.USER_TYPE 
	FROM user_module_access uma
	INNER JOIN modules m ON m.MODULE_ID = uma.MODULE_ID
	INNER JOIN user_types ut ON ut.USER_TYPE_ID = uma.USER_TYPE_ID
	AND uma.USER_TYPE_ID = pUserTypeID;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `spAddDoctorPurchase` (`pDoctorVisitID` INT, `pProductCode` VARCHAR(50), `pQtyRegular` INT, `pQtyFree` INT, `pPrice` DOUBLE, `pDiscount` DOUBLE, `pNetPrice` DOUBLE)  BEGIN
	DECLARE vTotalOrders INT;
	SET vTotalOrders = pQtyRegular + pQtyFree;

	set time_zone = '+08:00';

		DOCTOR_VISIT_ID,
		PRODUCT_CODE,
		QTY_REGULAR,
		QTY_FREE,
		PRICE,
		DISCOUNT,
		NET_PRICE,
		DATE_CREATED
	)
	VALUES 
	(
		pDoctorVisitID,
		pProductCode,
		pQtyRegular,
		pQtyFree,
		pPrice,
		pDiscount,
		pNetPrice,
		NOW()
	);

		UPDATE products SET
		QUANTITY = QUANTITY - vTotalOrders
	WHERE PRODUCT_CODE = pProductCode;

	SELECT 1 as 'result'; END$$

