CREATE DEFINER=`root`@`localhost` PROCEDURE `spAddUser` (`pFirstname` VARCHAR(100), `pMiddlename` VARCHAR(100), `pLastname` VARCHAR(100), `pUserTypeID` INT, `pUsername` VARCHAR(50), `pPassword` VARCHAR(100), `pAreaID` INT, `pStatus` INT, `pRemarks` VARCHAR(100), `pParentUserID` INT)  BEGIN
	set time_zone = '+08:00';

	IF NOT EXISTS (SELECT * FROM users WHERE USERNAME = pUsername) THEN
			FIRST_NAME,
			MIDDLE_NAME,
			LAST_NAME,
			USER_TYPE_ID,
			USERNAME, 
			PASSWORD,
			AREA_ID,
			DATE_CREATED,
			STATUS,
			REMARKS,
			PARENT_USER_ID
		)
		VALUES (
			pFirstname,
			pMiddlename,
			pLastname,
			pUserTypeID,
			pUsername,
			pPassword,
			pAreaID,
			NOW(),
			pStatus,
			pRemarks,
			pParentUserID
		);
		SELECT 
			1 AS 'result',
			'insert successful' as 'message';
	ELSE
		SELECT 
			0 AS 'result',
			'username already exists' as 'message';
	END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `spCheckDoctorBalance` (`pDoctorID` INT, `pTotalOrderAmount` DOUBLE)  BEGIN
	DECLARE vDoctorBalance DOUBLE;
	DECLARE vBalanceExpirationDate DATETIME;

	SET time_zone = '+08:00'; 	
	SELECT 
		BALANCE, 
		BALANCE_EXPIRATION_DATE
	INTO vDoctorBalance, vBalanceExpirationDate 
	FROM doctor_balance 
	WHERE DOCTOR_ID = pDoctorID; 
	IF (vDoctorBalance >= pTotalOrderAmount AND NOW() < vBalanceExpirationDate) THEN
		SELECT 
			1 AS 'result',
			'Can transact. Doctor has sufficient balance and balance not expired' AS 'message';
	ELSE
		SELECT 
			0 AS 'result',
			'Cannot transact. Insufficient funds and/or expired balance.' AS 'message';
	END IF;




END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `spCheckProductStocks` (`pProductCode` VARCHAR(100), `pTotalOrderQuantity` INT)  BEGIN

	DECLARE vProductsQuantity INT;
	
	SELECT QUANTITY INTO vProductsQuantity FROM products 
	WHERE PRODUCT_CODE = pProductCode;




	IF (vProductsQuantity >= pTotalOrderQuantity) THEN
		SELECT 
			1 AS 'result',
			'Can transact. Quantity equal or more than orders' AS 'message';
	ELSE
		SELECT 
			0 AS 'result',
			'Cannot transact. Orders more than quantity / stocks' AS 'message';
	END IF;


END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `spDeductDoctorBalance` (`pDoctorID` INT, `pTotalOrderAmount` DOUBLE)  BEGIN

	UPDATE DOCTOR_BALANCE SET 
	BALANCE = BALANCE - pTotalOrderAmount
	WHERE DOCTOR_ID = pDoctorID;

	SELECT 1 AS 'result';

END$$

