CREATE DEFINER=`root`@`localhost` PROCEDURE `spDisplayUsers` ()  BEGIN
	
	SELECT 
        U.USER_ID AS 'userID',
        U.FIRST_NAME AS 'firstName',
        U.MIDDLE_NAME AS 'middleName',
        U.LAST_NAME AS 'lastName',
        U.USER_TYPE_ID AS 'userTypeID',
        UT.USER_TYPE AS 'userType',
        U.USERNAME AS 'userName',
        U.AREA_ID AS 'areaID',
        A.AREA_NAME AS 'areaName',
        U.DATE_CREATED AS 'dateCreated',
        U.REMARKS AS 'remarks',
		CASE
			WHEN U.STATUS = 1 THEN 'Enabled'
			WHEN U.STATUS = 0 THEN 'Disabled'
		END AS 'status',
	
        U.PARENT_USER_ID AS 'parentUserID',
        CONCAT(PARENT.FIRST_NAME, ' ', PARENT.LAST_NAME) AS 'parentUser'
    FROM users U
    INNER JOIN user_types UT ON U.USER_TYPE_ID = UT.USER_TYPE_ID
    INNER JOIN area A ON U.AREA_ID = A.AREA_ID
    JOIN USERS parent ON parent.USER_ID = U.PARENT_USER_ID
	LIMIT 0,100;
END$$

