CREATE DEFINER=`root`@`localhost` PROCEDURE `spLogin` (IN `pUsername` VARCHAR(100), IN `pPassword` VARCHAR(100), IN `pLocationLat` DOUBLE, IN `pLocationLong` DOUBLE, IN `pRemarks` VARCHAR(500))  BEGIN
	set time_zone = '+08:00';

	IF EXISTS (SELECT * FROM users WHERE USERNAME = pUsername AND PASSWORD = pPassword AND STATUS = 1) THEN

		
			USER_ID,
			ACTIVITY_DATETIME,
			ACTIVITY_TYPE,
			LOCATION_LAT,
			LOCATION_LONG,
			REMARKS
		)
		SELECT 
			USER_ID,
			NOW(),
			'API_LOGIN',
			pLocationLat,
			pLocationLong,
			pRemarks
			
		FROM users
		WHERE USER_ID = (SELECT USER_ID FROM users WHERE USERNAME = pUsername 
							AND PASSWORD = pPassword AND STATUS = 1);

				SELECT 
			U.USER_ID AS 'userID',
			U.FIRST_NAME AS 'firstName',
			U.LAST_NAME AS 'lastName',
			UT.USER_TYPE as 'userType',
			1 AS 'result',
			'login successful' AS 'message'		
		FROM users U
		INNER JOIN user_types UT ON UT.USER_TYPE_ID = U.USER_TYPE_ID
		WHERE USER_ID = (SELECT USER_ID FROM users WHERE USERNAME = pUsername 
							AND PASSWORD = pPassword AND STATUS = 1);
	ELSE
		SELECT 
			0 AS 'result',
			'login failed' as 'message';
	END IF;
	
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `spLogout` (`pUserID` INT, `pLocationLat` DOUBLE, `pLocationLong` DOUBLE, `pRemarks` VARCHAR(1000))  BEGIN
	set time_zone = '+08:00';
	IF EXISTS (SELECT * FROM users WHERE USER_ID = pUserID) THEN
			USER_ID,
			ACTIVITY_DATETIME,
			ACTIVITY_TYPE,
			LOCATION_LAT,
			LOCATION_LONG,
			REMARKS
		)
		VALUES (
			pUserID,
			NOW(),
			'API_LOGOUT',
			pLocationLat,
			pLocationLong,
			pRemarks
		);

		SELECT
			1 AS 'result', 
			'logout successful' as 'message'; 	ELSE
		SELECT
			0 AS 'result', 
			'user not found' as 'message'; 	END IF;

	
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `spSearchUsers` (`pKeyword` VARCHAR(100))  BEGIN
	SELECT 
		U.USER_ID AS 'userID',
		U.FIRST_NAME AS 'firstName',
		U.MIDDLE_NAME AS 'middleName',
		U.LAST_NAME AS 'lastName',
		U.USER_TYPE_ID AS 'userTypeID',
		UT.USER_TYPE AS 'userType',
		U.USERNAME AS 'userName',
		U.AREA_ID AS 'areaID',
		A.AREA_NAME AS 'areaName',
		U.DATE_CREATED AS 'dateCreated',
		U.REMARKS AS 'remarks',
		U.STATUS AS 'status',
		U.PARENT_USER_ID AS 'parentUserID',
		CONCAT(PARENT.FIRST_NAME, ' ', PARENT.LAST_NAME) AS 'parentUserFullname'
	FROM USERS U
	INNER JOIN USER_TYPES UT ON U.USER_TYPE_ID = UT.USER_TYPE_ID
	INNER JOIN AREA A ON U.AREA_ID = A.AREA_ID
	JOIN USERS parent ON parent.USER_ID = U.PARENT_USER_ID
	WHERE U.FIRST_NAME LIKE CONCAT('%', pKeyword, '%')
	OR U.MIDDLE_NAME LIKE CONCAT('%', pKeyword, '%')
	OR U.LAST_NAME LIKE CONCAT('%', pKeyword, '%')
	OR U.USERNAME LIKE CONCAT('%', pKeyword, '%')
	OR U.REMARKS LIKE CONCAT('%', pKeyword, '%');
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `spWebLogin` (`pUsername` VARCHAR(50), `pPassword` VARCHAR(100))  BEGIN
	IF EXISTS (SELECT * FROM USERS WHERE USERNAME = pUsername AND PASSWORD = pPassword AND STATUS = 1) THEN
						
		SELECT 
			U.USER_ID AS 'userID',
			U.FIRST_NAME AS 'firstName',
			U.LAST_NAME AS 'lastName',
			U.USER_TYPE_ID AS 'userTypeID',
			UT.USER_TYPE AS 'userType',
			1 AS 'result',
			'login successful' as 'message'
		FROM users U
		INNER JOIN user_types UT ON UT.USER_TYPE_ID = U.USER_TYPE_ID
		WHERE USERNAME = pUsername AND PASSWORD = pPassword;
	ELSE
		SELECT 
			0 AS 'result',
			'login failed' as 'message';
	END IF;
END$$

